import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './components/HomePage'; // Adjust the import path as needed
import HackathonsPage from './components/HackathonsPage'; // Adjust the import path as needed
import HackathonDetailsPage from './components/HackathonDetailsPage'; // Adjust the import path as needed
import SubmissionsPage from './components/SubmissionsPage'; // Adjust the import path as needed
import LoginPage from './components/LoginPage'; // Adjust the import path as needed
import SignupPage from './components/SignupPage'; // Adjust the import path as needed
import OrganizerDashboard from './components/OrganizerDashboard'; // Adjust the import path as needed
import UserDashboard from './components/UserDashboard'; // Adjust the import path as needed

const App = () => {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/signup" element={<SignupPage />} />
          <Route path="/hackathons" element={<HackathonsPage />} />
          <Route path="/hackathons/:id" element={<HackathonDetailsPage />} />
          <Route path="/hackathons/:id/submissions" element={<SubmissionsPage />} /> {/* Added this route */}
          <Route path="/organizer/dashboard" element={<OrganizerDashboard />} />
          <Route path="/user/dashboard" element={<UserDashboard />} />
          <Route path="*" element={<div className="text-center text-secondary">404 - Page Not Found</div>} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
